import React from "react";
import { Container } from "semantic-ui-react";
import { BookEntry } from "./BookEntry";
import { GrabBook } from "./GrabBook";

function Recommendation() {
  return (
    <div className="App">
      <Container>
        <BookEntry/>
        <GrabBook/>
      </Container>
    </div>
  );
}
export default Recommendation;
